import React from 'react';
import styled from 'styled-components';

const Todoitembox = styled.div`
  display: flex;
  align-items : center;
  padding-top: 10px;
  padding-bottom: 10px;
  /* background-color: beige;
  border-bottom: 1px solid #e9ecef; */
`
const Circle = styled.div`
  width: 32px;
  height: 32px;
  border-radius: 16px;
  border: 1px solid #ced4da;
  font-size: 24px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-right: 20px;
  cursor: pointer;
`
function Todoitem() {
  return(
    <Todoitembox>
      <Circle><Mdone /></Circle>
    </Todoitembox>
  )
}

export default Todoitem;
